jQuery(document).foundation();

jQuery(document).ready(function() {

    //Image Grid

    // Flex Images

    jQuery('.xsmall-tiles.flex-images').flexImages({rowHeight: 190});
    jQuery('.small-tiles.flex-images').flexImages({rowHeight: 230});
    jQuery('.medium-tiles.flex-images').flexImages({rowHeight: 520});
    jQuery('.large-tiles.flex-images').flexImages({rowHeight: 740});

    /* Nivo Lightbox */

    jQuery('a.light').nivoLightbox();
    jQuery('a.search-button').nivoLightbox({effect: 'fade', theme: 'custom'});
    jQuery('a.share-button').nivoLightbox({effect: 'fade', theme: 'custom'});
    jQuery('a.bright').nivoLightbox({theme: 'custom'});

    /* Responsive Menu */

    jQuery(".nav-primary").flexNav({'animationSpeed' : 500, 'buttonSelector': '.menu-button-large', 'hoverIntent': true });
    jQuery(".nav-secondary").flexNav({'animationSpeed' : 500, 'buttonSelector': '.menu-button-mini', 'hoverIntent': true });

    /* Scroll To Top */

    jQuery(".scroll-top").hide();

    jQuery(function () {
        jQuery(window).scroll(function () {
            if (jQuery(this).scrollTop() > 100) {
                jQuery('.scroll-top').fadeIn();
            } else {
                jQuery('.scroll-top').fadeOut();
            }
        });

        jQuery('.scroll-top a').click(function () {
            jQuery('body,html').animate({
                scrollTop: 0
            }, 400);
            return false;
        });
    });


    /* Slider */

    jQuery('.slider').owlCarousel({
        loop: true,
        nav: true,
        navText: ['',''],
        dots: false,
        mobileBoost: true,
        margin: 0, // margin 10px till 960 breakpoint
        merge: true,
        center: false,
        autoplay:true,
        autoplayTimeout: 3000,
        autoplaySpeed: 6000,
        smartSpeed: 1500,
        autoplayHoverPause: true,
        items: 1
    });

    jQuery('.simple-carousel').owlCarousel({
        loop: true,
        items: 1,
        nav: true,
        dots: false,
        mobileBoost: true,
        navText: ['',''],
        margin: 0,
        merge: false,
        center: true,
        autoplay:true,
        autoplayTimeout: 3000,
        autoplaySpeed: 6000,
        smartSpeed: 1500,
        autoplayHoverPause: true,
        responsive:{
            768:{
                items:2 // from this breakpoint 960 to 1199
            }
        }
    });

    jQuery('.text-carousel').owlCarousel({
        loop: true,
        items: 1,
        nav: true,
        dots: false,
        nestedItemSelector: 'row',
        mobileBoost: true,
        navText: ['',''],
        margin: 0,
        merge: false,
        center: true,
        autoplay:true,
        autoplayTimeout: 3000,
        autoplaySpeed: 6000,
        smartSpeed: 1500,
        autoplayHoverPause: true,
        responsive:{
            960:{
                items:2 // from this breakpoint 678 to 959
            }
        }
    });

    jQuery('.newsticker').owlCarousel({
        loop: true, // loop is true up to 1199px screen.
        nav: false, // is true across all sizes
        dots: false,
        mobileBoost: true,
        autoWidth:true,
        margin: 10, // margin 10px till 960 breakpoint
        merge: false,
        center: true,
        autoplay:true,
        autoplayTimeout: 100,
        autoplaySpeed: 3000,
        smartSpeed: 250,
        autoplayHoverPause: true
    });

});


/* Fixed Menu */
var nav = jQuery('.stick');

jQuery(window).scroll(function () {
    if (jQuery(this).scrollTop() > 300 ) {
        nav.addClass("fixed");
    } else {
        nav.removeClass("fixed");
    }
});


